(window.webpackJsonp=window.webpackJsonp||[]).push([[5],{80:function(a){a.exports=JSON.parse('{"metadata":{"timed":false,"story ID":"b26c7483-4a03-4702-bec2-6e893219f3f0","title":{"_default":"asha1"},"media":{"audio":"","video":""},"languages":["es","cni","en"],"date_created":"","date_uploaded":"1/24/2026","source":{"_default":""},"description":"","genre":"","author":"","glosser":"","speakers":[],"xml_file_name":"asha1.xml","source_filetype":"FLEx","tier IDs":{"Traducción":{"subdivided":false}},"speaker IDs":{}},"sentences":[{"num_slots":21,"text":"Apa ikenketsatana otimi ebankaro orijaniki, ojati ojokiro kajara, oñaapaakeri pakitsa irijaniki kameetsa yora pakitsa, meeka ora tsinanejaniki aakeri aanakeri yora pakitsa.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":21,"value":"Mi papá me cuenta que había una vez una pequeña joven que, cuando se fue a botar la basura y vio un hermoso gavilán pequeño, esta mujercita cogió al gavilán y se lo llevó. "}]}],"sentence_id":1},{"num_slots":10,"text":"Okantapaakeri iri‘ apa’ pameneri kameetsaitake pakitsa, payeriketi pinampityari’, onampitakari meeka.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":10,"value":"Luego, [la joven] le dijo a su papá: “¡Papa, mira a este hermoso gavilán! Tenlo y críalo”."}]}],"sentence_id":2},{"num_slots":13,"text":"Ari meeka opiri yobari ainiri maaroni, yantyaritake meeka kameetsa kitamarori, kameetsa yora pakitsa.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":13,"value":"Comenzó a criarlo, lo alimentaba con toda clase de comida, crecía sano y era de color blanco."}]}],"sentence_id":3},{"num_slots":5,"text":"Ari meeka yantyaritanake meeka pakitsa.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":5,"value":"Ahora, el gavilán comenzó a crecer muy grande."}]}],"sentence_id":4},{"num_slots":18,"text":"Meeka ari ora ijatake yai kemperi, meeka yai yora sampakiti yaake kapichaji sampakiti, yamapaakenero yojokakenero, ora tsinane aabakeri.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":18,"value":"Una vez que se fue a cazar [el gavilán], agarró una paloma y se le llevó a la mujercita, ella lo comía. "}]}],"sentence_id":5},{"num_slots":21,"text":"Ari kimotani meeka otsipaniki ijat yamakenero yora samani, ari otsipaniki aikero yaminiro irijaniki, antyari yamake․ Oñaabajatiri yojokapaajiniro, meeka yamakenero maniro antyari.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":21,"value":"A medida que iba creciendo más, el gavilán cazó un majás. Traía presas grandes y medianas. Luego, cuando [la mujercita] lo vio regresar, había traído un venado grande para ella."}]}],"sentence_id":6},{"num_slots":15,"text":"Ari meeka ora ipianaka ipeaita ¿paita ipeantaitari Ijati ora ibetsikiro imperita ibanko yaantanakearori ora tsinane.?","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":15,"value":"Un día, se perdió y demoró en regresar [el gavilán]: “¿Por que demora?” [se preguntó la mujercita]. Estaba haciendo su casa [el gavilán] en una roca para llevar ahí a la mujer."}]}],"sentence_id":7},{"num_slots":15,"text":"Ari meeka ibetsikake maaroni, ipeaita iñaabajatiri․ Yamakenero kemari antyari, obajeitabaka․ Kimoshire iniro okanti“ kameetsaitake pakitsa”.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":15,"value":"Comenzó a arreglar todo [el gavilán], se demoró un tiempo. Luego, [el gavilán] había traído una sachavaca grande para que ella coma. La mamá de la jovencita estaba feliz y decía: “Qué bueno es el gavilán”."}]}],"sentence_id":8},{"num_slots":15,"text":"Ari meeka yora pakitsa antyaritake antyaro ishetaki, ibanki antyaro․ Meeka ijati yaanakenero ari ora opaitari.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":15,"value":"Ahora, el gavilán creció más y también crecieron sus garras y sus alas. Se volvió a ir y a su regreso trajo más cosas."}]}],"sentence_id":9},{"num_slots":13,"text":"Tee iyote yamenaiti yaatapaaji ora iraantanakearori ipokaji meeka yaatapaake inchatoki, yameniro ora tsinane.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":13,"value":"El gavilán estaba mirando a la mujercita desde la rama de un árbol sin que ella lo supiera. "}]}],"sentence_id":10},{"num_slots":26,"text":"Opishiti, opishiti obanko ari ijatanaji meeka yaranaji, paitarika ikenkeshireakari ijatanaji, impoiji meeka, ora opaitari, itsonkakero ora ibanko imperita maaroni, meekatya meeka, irotaintsi irayero ora meeka tsinane,","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":26,"value":"La mujercita estaba barriendo su casa cuando vino [el gavilán] a recogerla: “¿Qué estaría pasando?” [se preguntó la mujercita]. Luego, emprendió vuelo nuevamente. Cuando terminó [de construir] su casa en las rocas, regresó a recoger a su mujer."}]}],"sentence_id":11},{"num_slots":25,"text":"Ipokake meeka iñaapakero osaikaiti․ Tee yatapeeji ipokake anta intsipaiji yatsomaanakero ora tsinane, meeka yaanakero meeka anta imperitaki ibankoki, yobakero jenoki, meeka ibametakero yobakaaro yora ashaninka.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":25,"value":"El gavilán vio a la mujercita sentada, se acercó rápidamente, la sujetó [con sus garras] y se la llevó a su casa en las rocas, allá en lo alto. Luego, [el gavilán] la acostumbró [a la mujercita] a comer humanos. "}]}],"sentence_id":12},{"num_slots":25,"text":"Yora ashaninkapee Enisati ikoabeta ipokeme yamajati ari ipeakaari yaabajiniro obakari ari ishemakari, meeka yora itsipa ashaaninka yantake shirampari antyari ibatsa yantakeneri ora ibichaake ora kipatsi.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":25,"value":"A los asháninka del río Ene que querían bajarse, el gavilán los hacía desaparecer para que sean el alimento de su esposa. Entonces, enojados [los asháninka] comenzaron a construir un hombre grande y gordo [de barro]. "}]}],"sentence_id":13},{"num_slots":42,"text":"Ari meeka iñaabake ikantake, okanti tsinane“ paabakenari yonta yora opaitari ashaaninka antyari” ibatsa, meeka ikoi irayerime ari isaantapaka ishetaki imabetyame iraranajeme meeka yora ashaaninka saikaintsiri itsipa ashaaninka yaitaitarime ipasatakeri, ipasatakeri, ipasatakerimeeka kamake yora pakitsa ora ibanki sokijayetanaintsiri ibanki, amajayetanake maaroni kempetanaka pitotsi.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":42,"value":"Cuando el gavilán lo vio [al hombre de barro], la mujer le dijo: “Atrapa a ese hombre grande” y el gavilán comenzó a volar para agarrarlo, pero sus garras se quedaron atrapadas en el barro, ya no podía salir. Luego, salió una persona [que estaba escondida] y comenzó a golpear fuertemente al gavilán hasta matarlo. Las plumas que salieron de sus alas comenzaron a flotar en el río y se convirtieron en una canoa."}]}],"sentence_id":14},{"num_slots":15,"text":"Meeka ora ikoi opaitari iraajerome onta tsinane tee imatajeroji anta tsompoina yobakero meeka yora pakitsa.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":15,"value":"Cuando quisieron rescatar a la mujer, no pudieron hacer nada porque la casa del gavilán estaba muy escondida."}]}],"sentence_id":15}]}')}}]);